import React, { Component } from 'react';
import '../App.css';
import {BrowserRouter as Router, Route} from "react-router-dom";

const Home = () => {
  return (
    <div>
    <h1>Home!</h1>
    </div>
    )
}

const Login = () => {
  return (
    <div>
      <form>
        <div>
          <input type="text" name="email" placeholder="Email Address" />
        </div>
      </form>
    </div>
    )
}

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Route path="/" render={Login} />
        </Router>
      </div>
    );
  }
}


export default App;
